Jika jajaran genjang di atas adalah jajaran genjang siku-siku, maka panjang sisi-sisi yang berhadapan adalah sama panjang. Jadi panjang sisi $(5,3)$ dan $(x,y)$ adalah sama dengan panjang sisi $(6,8)$ dan $(7,4)$. Kita gunakan rumus jarak untuk menghitung panjang sisi-sisi tersebut.

\begin{align*}
\sqrt{(x-5)^2+(y-3)^2}&=\sqrt{(6-7)^2+(8-4)^2}\\
\Rightarrow\qquad (x-5)^2+(y-3)^2&=20
\end{align*}

Selain itu, jajaran genjang siku-siku, jadi sudut antara sisi-sisi $(5,3)$ dan $(6,8)$ adalah $90^\circ$. Jadi, panjang sisi-sisi tersebut adalah tegak lurus. Kita gunakan rumus dot product untuk menghitung panjang sisi-sisi tersebut.

\begin{align*}
(5-6)(8-3)+(3-8)(x-6)&=0\\
\Rightarrow\qquad -3x+24&=0\\
\Rightarrow\qquad x&=8
\end{align*}

Karena $x > 7$, maka $x = 8$. Kita substitusikan $x$ ke persamaan $(x-5)^2+(y-3)^2=20$ untuk menghitung $y$.

\begin{align*}
(8-5)^2+(y-3)^2&=20\\
\Rightarrow\qquad (y-3)^2&=9\\
\Rightarrow\qquad y-3&=\pm3\\
\Rightarrow\qquad y&=6\text{ or }0
\end{align*}

Karena jajaran genjang siku-siku, jadi sisi-sisi $(5,3)$ dan $(7,4)$ adalah tegak lurus. Jadi, jarak antara $(5,3)$ dan $(7,4)$ adalah panjang sisi $(6,8)$ dan $(x,y)$. Kita gunakan rumus jarak untuk menghitung jarak antara $(5,3)$ dan $(7,4)$.

\begin{align*}
\sqrt{(7-5)^2+(4-3)^2}&=\sqrt{(6-8)^2+(8-y)^2}\\
\Rightarrow\qquad 2&=\sqrt{4+(8-y)^2}\\
\Rightarrow\qquad 4&=4+(8-y)^2\\
\Rightarrow\qquad 0&=(8-y)^2\\
\Rightarrow\qquad y&=8
\end{align*}

Karena $y = 8$, maka $x + y = 8 + 8 = \boxed{16}$.

Dengan mengalikan polinomial-2, diperoleh
\begin{align*}
(3t^2+5t+a)(4t^2+bt-2) &= 12t^4+3bt^3-6t^2+20t^3+5bt^2-10t+4at^2+abt-2a\\
&= 12t^4+(3b+20)t^3+(4a+5b-6)t^2+(ab-10)t-2a
\end{align*}
Karena hasil kali dari polinomial-2 adalah $12t^4+26t^3-8t^2-16t+6$, maka
\begin{align*}
3b+20 &= 26 \quad\Rightarrow\quad b=2\\
4a+5b-6 &= -8 \quad\Rightarrow\quad a=-1\\
ab-10 &= -16 \quad\Rightarrow\quad a=-1\\
-2a &= 6 \quad\Rightarrow\quad a=-3
\end{align*}
Dari penyelesaian di atas, diperoleh $a=-1$ dan $b=2$. Jadi, $a+b=\boxed{1}$.

