Karena $2^2$ dan $5^7$ adalah bilangan-bilangan prima, maka bilangan desimal dari $\frac{21}{2^2 \cdot 5^7}$ akan berakhir. Untuk mengubah bentuk pecahan ini menjadi desimal, kita perlu mengalikan dengan bilangan yang akan mengurangi pangkat 2 dari 2 dan pangkat 7 dari 5. Kita gunakan bilangan $2^5 \cdot 5^2$ untuk mengurangi pangkat 2 dari 2 dan pangkat 7 dari 5. Kita peroleh: \begin{align*}
\frac{21}{2^2 \cdot 5^7} \cdot \frac{2^5 \cdot 5^2}{2^5 \cdot 5^2} &= \frac{21 \cdot 2^5 \cdot 5^2}{2^7 \cdot 5^9} \\
&= \frac{21 \cdot 32 \cdot 25}{10^9} \\
&= \frac{16800}{10^9} \\
&= \boxed{0.00168}.
\end{align*}

\begin{align*}
\frac{4321}{5^7\cdot2^8}&=\frac{4321}{10^7\cdot2}\\
&=\frac{4321}{20000000}\cdot\frac{1}{2}\\
&=\frac{2160.5}{100000000}
\end{align*}The numerator is odd, so the decimal representation of the fraction ends in $00000000.21605$. The sum of the digits is $2+1+6+0+5=\boxed{14}$.

