Dari diagram di atas, diperoleh $\angle ADC = \angle BDC$. Misalkan $\angle ADC = \angle BDC = x$. Jadi, $\angle ADB = \angle ACB = 180^\circ - x$. Jadi, luas daerah diarsir adalah

\begin{align*}
\frac{5}{12} \cdot \pi \cdot 2^2 &= \frac{1}{2} \cdot 2^2 \cdot \sin (180^\circ - x) + \frac{1}{2} \cdot 1^2 \cdot \sin x \\
&= 2 \sin x + \frac{1}{2} \sin x \\
&= \frac{5}{2} \sin x.
\end{align*}Dari sini, didapat $\sin x = \frac{2}{5}$. Karena $0^\circ < x < 180^\circ$, maka

\begin{align*}
x &= \sin^{-1} \frac{2}{5} \\
&\approx 23.578^\circ.
\end{align*}Jadi, derajat ukuran $\angle ADC$ adalah $\boxed{23.578^\circ}$.

