Perhatikan gambar di bawah. Titik $P$ adalah proyeksi titik $(6,0)$ pada garis $y=2x-2$. Jarak terpendek dari titik $(6,0)$ ke garis $y=2x-2$ adalah jarak $P$ ke $(6,0)$.

[asy]
unitsize(1 cm);

pair A, B, P;

A = (6,0);
B = (0,0);
P = (2,2);

draw((-1,0)--(7,0));
draw((0,-1)--(0,7));
draw(A--B,dashed);
draw(P--A,dashed);

dot("$A$", A, S);
dot("$B$", B, S);
dot("$P$", P, NE);
[/asy]

Karena $P$ adalah proyeksi dari $A$ pada garis $y=2x-2$, maka garis $AP$ tegak lurus dengan garis $y=2x-2$. Garis $y=2x-2$ mempunyai gradien $2$, jadi garis $AP$ mempunyai gradien $-\frac{1}{2}$. Garis $AP$ melalui titik $(6,0)$, jadi persamaan garis $AP$ adalah $y=-\frac{1}{2}(x-6)$. Persamaan garis $y=2x-2$ adalah $y=2x-2$. Koordinat titik $P$ adalah himpunan penyelesaian sistem persamaan
\begin{align*}
y &= -\frac{1}{2}(x-6), \\
y &= 2x-2.
\end{align*}Substitusikan $y=2x-2$ ke dalam persamaan pertama, didapat
\[2x-2 = -\frac{1}{2}(x-6).\]Dengan mengalikan kaki kiri dengan $2$, didapat
\[4x-4 = -(x-6).\]Dengan mengalikan kaki kiri dengan $-1$, didapat
\[4x-4 = -x+6.\]Dengan menggabungkan suku-suku sejenis, didapat
\[5x = 10,\]jadi $x=2$. Karena $y=2x-2$, jadi $y=2(2)-2=2$. Jadi, koordinat titik $P$ adalah $(2,2)$. Jarak antara titik $(6,0)$ dan titik $(2,2)$ adalah
\[\sqrt{(6-2)^2 + (0-2)^2} = \sqrt{16+4} = \sqrt{20} = \boxed{2\sqrt{5}}.\]

Kita coba menentukan nilai $n$ dengan cara menambahkan semua angka dalam kotak. Kita peroleh \begin{align*}
&(n-3)+3+(n+1)+(n+2)+2n-9+1+2+n+(n-1)\\
&\qquad=5n-11.
\end{align*}Karena jumlah semua angka dalam kotak adalah sama dengan jumlah angka dalam setiap baris, kolom, dan masing-masing dari $2$ diagonal utama, maka kita peroleh \begin{align*}
&\frac{1}{3}(5n-11)=n-3\\
\Rightarrow\qquad &5n-11=3n-9\\
\Rightarrow\qquad &2n=2\\
\Rightarrow\qquad &n=\boxed{1}.
\end{align*}
